import React, { useState, useEffect } from "react";
import axios from "axios";
import DeleteIcon from "@material-ui/icons/Delete";

function Note(props) {
  const [notes, setNotes] = useState([]);
  const listNote = notes.map((note) => <h1>{note.title}</h1>);

  // Receives data from backend
  //Equivilent to componendDidMount componentDidUpdate
  useEffect(() => {
    axios.get("http://localhost:5000/list/").then((response) => {
      setNotes((prevValues) => [...prevValues, response.data]);
    });
  }, []);

  return (
    <div className="note">
      <h1>{notes[0].title}</h1>
    </div>
  );
}

export default Note;
